CREATE TABLE mortality_cause(
   State                   VARCHAR(20) NOT NULL
  ,Year                    INTEGER  NOT NULL
  ,All_causes              INTEGER  NOT NULL
  ,Alzheimers_disease      INTEGER  NOT NULL
  ,Cancer                  INTEGER  NOT NULL
  ,CLRD                    INTEGER  NOT NULL
  ,Diabetes                INTEGER  NOT NULL
  ,Heart_disease           INTEGER  NOT NULL
  ,Influenza_and_pneumonia INTEGER  NOT NULL
  ,Kidney_disease          INTEGER  NOT NULL
  ,Stroke                  INTEGER  NOT NULL
  ,Suicide                 INTEGER  NOT NULL
  ,Unintentional_injuries  INTEGER  NOT NULL
  ,PRIMARY KEY(State,Year)
);

CREATE TABLE state_codes(
   State        VARCHAR(20) NOT NULL PRIMARY KEY
  ,Code         VARCHAR(2) NOT NULL
);

SELECT s.code as statecode, m.* INTO mortality FROM mortality_cause m LEFT JOIN state_codes s ON m.state = s.state;
DROP TABLE mortality_cause;

